  [],\n\t\"revision_timestamp\": \"2015-12-09T02:44:18.441694\",\n\t\"name\": \"stetson38-samples-collected-along-transects-off-the-eastern-united-states-in-1938\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study was undertaken to provide information
  on the characteristics and distribution of surficial sediments off the eastern United
  States. Accordingly, long traverses were run across the continental shelf and in
  most case carrying over the shelf break. This data set includes data from those
  9 traverses which were conducted north of Virginia. These data constitute the first
  systematic sampling of the U.S. Atlantic margin to show the effects of environmental
  factors (e.g. increasing distance from shore, water depth) on the sediment distribution.
  Sampling was performed with a primitive grab sampler; navigational methods were
  not discussed in this report.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
